{
"application": "GATK",
"other_software": [
"bwa",
"samtools",
"picard",
"fastx_toolkit"
],
"resource_requirements": {
"memory": "86G",
"cores": "25",
"tmp_dir": "/home/taslima/Data/TMP"
},
"dependencies": [
"GenomeAnalysisTK.jar",
"PhalliiHAL_496_v2.0.softmasked.fa",
"PhalliiHAL_496_v2.0.chr",
"PhalliiHAL_496_v2.chr.length"
],
"environment": {
"LC_ALL": "C"
},
"input": {
"gvcf_files": "/home/taslima/Data/PHNatAcc_SNP/FinalVCF/*$chr.BSQR.gvcf",
"reference_genome": "/home/taslima/Data/DBs/PH/PhHAL/PhalliiHAL_496_v2.0.softmasked.fa",
"chromosome_length_file": "/home/taslima/Data/DBs/PH/PhHAL/PhalliiHAL_496_v2.chr.length"
},
"output": {
"combined_vcf_files": "/home/taslima/Data/PHNatAcc_SNP/CombVCF_AllSites/PHNatAcc_TRANS_${chr}_Comb.vcf"
},
"notes": [
"This script uses the GATK GenotypeGVCFs tool to combine multiple GVCF files into a single VCF file.",
"It is designed to be run on a cluster using SLURM.",
"The script uses a loop to process each chromosome separately.",
"The script requires a specific version of GATK (3.8.0).",
"The script uses a temporary directory to store intermediate files."
]
}
```
